import React from 'react'
import Header from '../../components/admin/Header'

const Deshboard = () => {
  return (
    <div>
        <nav className='fixed w-full'>
            <Header></Header>
        </nav>
        <div className='h-[2000px] bg-red-400 w-full border'></div>
    </div>
  )
}

export default Deshboard;
